import React from "react"
import Icon from "./icon"
import NavigationItem from "./navigation-item";



function Header(props){
  const items = {
    heading: <h5>Буюк Ипак Йўли Транс</h5>,
    addIcon: <Icon typeIcon = "fas fa-user-plus" color = "#06ab00"/>,
    printIcon: <Icon typeIcon = "fas fa-print" color = "#2499ff"/>,
    excelIcon: <Icon typeIcon = "fal fa-table" color = "#ff9500"/>,
    statIcon: <Icon typeIcon = "fas fa-analytics" color = "#ff9500"/>,
    filterIcon: <Icon typeIcon = "fas fa-sort" color = "#ff9500"/>,
    trashIcon:  <Icon typeIcon = "fas fa-trash" color = "#e30505"/>,
    searchInput:  <input type="text" placeholder="Излаш..." name="search"   id="searchInput" />
  };

  return (
    <nav className="navigation-bar">
      <ul className="navigation-list">
       
        <NavigationItem 
           item = {items.heading}
        />
    
    
        <li class="navigation-item">
           
        </li>
        
      </ul>
    </nav>
    
  )
}

export default Header;
